class ParseNestedParensTest {
    @Test
    void testParseNestedParens() {
        assertEquals(ParseNestedParens.parseNestedParens("(()()) ((())) () ((())()())"), Arrays.asList(2, 3, 1, 3));
        assertEquals(ParseNestedParens.parseNestedParens("() (()) ((())) (((())))"), Arrays.asList(1, 2, 3, 4));
        assertEquals(ParseNestedParens.parseNestedParens("(()(())((())))"), Arrays.asList(4));
        assertEquals(ParseNestedParens.parseNestedParens("(()()) ((())) () ((())()())"), Arrays.asList(2, 3, 1, 3));
        assertEquals(ParseNestedParens.parseNestedParens("() (()) ((())) (((())))"), Arrays.asList(1, 2, 3, 4));
        assertEquals(ParseNestedParens.parseNestedParens("(()(())((())))"), Arrays.asList(4));
        assertEquals(ParseNestedParens.parseNestedParens("(()()) ((())) () ((())()())"), Arrays.asList(2, 3, 1, 3));
        assertEquals(ParseNestedParens.parseNestedParens("() (()) ((())) (((())))"), Arrays.asList(1, 2, 3, 4));
        assertEquals(ParseNestedParens.parseNestedParens("(()(())((())))"), Arrays.asList(4));
        assertEquals(ParseNestedParens.parseNestedParens("(()()) ((())) () ((())()())"), Arrays.asList(2, 3, 1, 3));
    }
}

class FilterBySubstringTest {
    @Test
    void testFilterBySubstring() {
        List<Object> list = new ArrayList<Object>();
        list.add("abc");
        list.add("bacd");
        list.add("cde");
        list.add("array");
        assertEquals(FilterBySubstring.filterBySubstring(list, "a"), Arrays.asList("abc", "bacd", "array"));
        assertEquals(FilterBySubstring.filterBySubstring(list, "b"), Arrays.asList("abc", "bacd"));
        assertEquals(FilterBySubstring.filterBySubstring(list, "c"), Arrays.asList("abc", "bacd", "cde"));
        assertEquals(FilterBySubstring.filterBySubstring(list, "d"), Arrays.asList("bacd"));
        assertEquals(FilterBySubstring.filterBySubstring(list, "e"), Arrays.asList("cde"));
        assertEquals(FilterBySubstring.filterBySubstring(list, "r"), Arrays.asList("array"));
        assertEquals(FilterBySubstring.filterBySubstring(list, "y"), Arrays.asList("array"));
        assertEquals(FilterBySubstring.filterBySubstring(list, "z"), Arrays.asList());
        assertEquals(FilterBySubstring.filterBySubstring(list, ""), Arrays.asList("abc", "bacd", "cde", "array"));
        assertEquals(FilterBySubstring.filterBySubstring(list, "ab"), Arrays.asList("abc", "bacd"));
    }
}

class SumProductTest {
    @Test
    void testSumProduct() {
        List<Object> numbers = new ArrayList<Object>();
        assertEquals(Arrays.asList(0, 1), SumProduct.sumProduct(numbers));
        numbers.add(1);
        numbers.add(2);
        numbers.add(3);
        numbers.add(4);
        assertEquals(Arrays.asList(10, 24), SumProduct.sumProduct(numbers));
        numbers.clear();
        numbers.add(1);
        numbers.add(1);
        numbers.add(1);
        assertEquals(Arrays.asList(3, 1), SumProduct.sumProduct(numbers));
        numbers.clear();
        numbers.add(100);
        numbers.add(0);
        assertEquals(Arrays.asList(100, 0), SumProduct.sumProduct(numbers));
        numbers.clear();
        numbers.add(3);
        numbers.add(5);
        numbers.add(7);
        assertEquals(Arrays.asList(15, 105), SumProduct.sumProduct(numbers));
        numbers.clear();
        numbers.add(10);
        assertEquals(Arrays.asList(10, 10), SumProduct.sumProduct(numbers));
    }
}

