    public void testNumericalLetterGrade() {
        List<Number> grades = new ArrayList<Number>();
        grades.add(4.0);
        grades.add(3);
        grades.add(1.7);
        grades.add(2);
        grades.add(3.5);
        List<String> result = NumericalLetterGrade.numericalLetterGrade(grades);
        List<String> expected = new ArrayList<String>();
        expected.add("A+");
        expected.add("B");
        expected.add("C-");
        expected.add("C");
        expected.add("A-");
