        words.add("name");
        words.add("enam");
        words.add("game");
        assertEquals("enam", FindMax.findMax(words));

        words.clear();
        words.add("aaaaaaa");
        words.add("bb");
        words.add("cc");
        assertEquals("aaaaaaa", FindMax.findMax(words));

        words.clear();
        words.add("abc");
        words.add("cba");
        assertEquals("abc", FindMax.findMax(words));

        words.clear();
        words.add("play");
        words.add("this");
        words.add("game");
        words.add("of");
        words.add("footbott");
