        words.clear();
        words.add("we");
        words.add("are");
        words.add("gonna");
        words.add("rock");
        assertEquals("gonna", FindMax.findMax(words));

        words.clear();
        words.add("we");
        words.add("are");
        words.add("a");
        words.add("mad");
        words.add("nation");
        assertEquals("nation", FindMax.findMax(words));

        words.clear();
        words.add("this");
        words.add("is");
        words.add("a");
        words.add("prrk");
        assertEquals("this", FindMax.findMax(words));

        words.clear();
        words.add("b");
        assertEquals("b", FindMax.findMax(words));

        words.clear();
        words.add("play");
        words.add("play");
        words.add("play");
        assertEquals("play", FindMax.findMax(words));
    }
}

